const DefaultTheme = {
  breakpoints: {
    mb: 0,
    tb: 768,
    dt: 1024,
  },
  colors: {
    primary: '#455acf',
    secondary: '#6F481E',
    success: '',
    danger: '',
    warning: '',
    info: '',
    light: '#fff',
    dark: '#231c20',
    grey: 'rgb(240,240,240)',
  },
  globals: {
    wrapperWidth: '1200px',
    modalBackdropColor: 'rgba(0,0,0,0.25)',
    buttonRadius: '0.3rem',
    buttonColor: 'primary',
    buttonSize: 'medium',
    buttonType: 'primary', // primary, outline, clean
  },
};

export default DefaultTheme;
